import React, { Component } from "react";
import { Table } from 'react-bootstrap';
import axios from 'axios'
import CreateAmiibo from "./modals/CreateAmiibo";
import Button from 'react-bootstrap/Button';
/*import SendMessage from "./modals/sendMessage";*/
/*import { Button } from 'react-bootstrap';*/

export default class Amiibos extends Component {
    state = {
        amiibos: [],
        amiibosfav: []
    }
    async componentDidMount() {
        const res = await axios.get(process.env.REACT_APP_HOSTNAME + "/amiibos/user/" + localStorage.getItem("user_id"));
        this.setState({ amiibosfav: res.data });

        const res2 = await axios.get("https://www.amiiboapi.com/api/amiibo");
        this.setState({amiibos: res2.data})
    }
    agregarAmiibo = async(id) =>{
        await axios.CreateAmiibo(process.env.REACT_APP_HOSTNAME+"/amiibos/" + id);
        window.location.reload();
    }
    eliminarAmiibo = async(id) =>{
        await axios.delete(process.env.REACT_APP_HOSTNAME+"/amiibos/" + id);
        window.location.reload();
    }
    
    render() {
        return (
            <div className="container">
                <h1>Amiibos</h1>
                <div className="row">
                    <div className="col-lg-6">
                    <h3>Lista de Amiibos Favoritos</h3>
                     <Table striped bordered hover>
                         <thead>
                             <tr>
                              <th>Personaje</th>
                              <th>Nombre</th>
                              <th>Tail</th>
                              <th>Acción</th>
                         </tr>
                     </thead>
                    <tbody>
                        {
                            this.state.amiibosfav.map(amiibofav =>
                                <tr key={amiibofav._id}>
                                    <td>{amiibofav.character}</td>
                                    <td>{amiibofav.name}</td>
                                    <td>{amiibofav.tail}</td>
                                    <td><Button onClick={() => this.eliminarAmiibo(amiibofav._id)} className="btn-danger">Eliminar</Button></td>
                               </tr>
                            )
                        }
                    </tbody>
                 </Table>
                </div>
                <div className="col-lg-6">
                <h3>Lista de Amiibos</h3>
                     <Table striped bordered hover>
                         <thead>
                             <tr>
                              <th>Personaje</th>
                              <th>Nombre</th>
                              <th>Tail</th>
                              <th>Acción</th>
                         </tr>
                     </thead>
                    <tbody>
                        {
                            this.state.amiibos.map(amiibo =>
                                <tr key={amiibo.amiiboSeries}>
                                    <td>{amiibo.character}</td>
                                    <td>{amiibo.gameSeries}</td>
                                    <td>{amiibo.tail}</td>
                                    <Button onClick={() => this.agregarAmiiboAmiibo(amiibo._id)} className="btn-danger">Agregar</Button>
                                </tr>
                            )
                        }
                    </tbody>
                 </Table>
                </div>
              </div>
           </div>
        )
    }
}
